import "./navbar.css";
import logo from "../../assets/Skyz-CRM-Avada-Logo.png";

const Navbar = () => {
  return (
    <header className="navbar">
          {/* <div className="logo">SkyzCRM</div> */}
          <div className="content">
              
          </div>
      <img src={logo} alt="logo" className="logo" />
  
    </header>
  );
};

export default Navbar;
